import React from 'react';
import AddUser from './components/AddUser';
import UsersList from './components/UsersList';

function App() {


    return (
        <div>
            <AddUser onAddUser={handleAddUser}></AddUser>
            <UsersList></UsersList>
        </div>
    );
}

export default App;
